import { AppActions } from "../actions";

const reducer = (state = {}, action) => {
    switch (action.type) {
      case AppActions.POST_LOGIN:
      console.log("payload:", action);
         state.userData = action.payload;
         return state;
      default:
        return state;
    }
  };

  export default reducer;
